import ReactDOM from 'react-dom/client';
import App from './components/App';
import './index.css';

// Création de la racine pour React 18+
const root = ReactDOM.createRoot(document.getElementById('root'));

// Rendu de l'application principale
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
